// src/layouts/Layout.jsx
import { Outlet } from "react-router-dom";
import Navbar from "../sections/Navbar";
import Footer from "../components/Footer";

export default function Layout() {
  return (
    <>
      <Navbar />
      <main className="container py-3">
        <Outlet />
      </main>
      <Footer />
    </>
  );
}
